  constructor(props) {
    super(props);

    this.state = {
      Student:[]
    };
  }

  goEmployees() {
    this.props.history.push("/students");
  }

  goHome() {
    this.props.history.push("/Home");
  }

  addStudent() {
    this.props.history.push("/add-student/_add");
  }

  
  render() {
    return (
      <div className="bg-black">
        <header >
            <h1 className="bg-black text-info float-start">
              <img
                src={logo}
                className="App-logo"
                alt="logo"
              />
              Employee Management System
           
           
      

            </h1>
            <div className="float-end">
           <ul>
           <li>aaaaaaa</li>
           <li>aaaaaaa</li>
           <li>aaaaaaa</li>
           <li>aaaaaaa</li>
           <li>aaaaaaa</li>
         </ul>
         </div>
         
          </header >
          
        
        
      </div>
    );
  }
}
export default  withRouter(HeaderComponent);
